import "./aboutMe.css";

export default function AboutMe () {
    return (
        <>
            <h1>about the team</h1>
            <p>If you’ve ever found investing to be complicated and a little scary, you’re not alone! We made Finance Buddy here to help you learn more about the basics of investing in different securities in an accessible and easy-to-comprehend way. This simulation simplifies what investing looks like to help people understand the basic structure of what the process looks like.</p>
        </>
    );
};
